import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding-top: 100px;
`;

const CourseHeader = styled.div`
  width: 300px;
  height: 50px;
  color: black;
  font-size: 15pt;
  border: 1px solid black;
  display: flex;
  align-items: center;
  justify-content: center;
  border-radius: 100px;
`;

const CouserProcessContainer = styled.div`
  width: 60%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 100px;
`;

const CourseProcessContainerColumn = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

const CourseImg = styled.img`
  width: 145px;
  height: 145px;
  object-fit: contain;
`;

const CourseDescription = styled.span`
  font-family: CoreGothicE-8;
  font-size: 16px;
  font-weight: 900;
  color: #000000;
  padding-left: 23px;
  padding-right: 23px;
`;

const CourseInfo = styled.span`
  font-family: CoreGothicE-5;
  font-size: 11px;
  font-weight: 500;
  color: #000000;
  margin-top: 10px;
  padding-left: 23px;
  padding-right: 23px;
`;

const DividerW = () => (
  <Container>
    <CourseHeader>실시간 원격 코스 진행 방식</CourseHeader>
    <CouserProcessContainer>
      <CourseProcessContainerColumn>
        <CourseImg
          src={require('../../Assets/Images/youngman/group29.png')}
        ></CourseImg>
      </CourseProcessContainerColumn>
      <CourseProcessContainerColumn>
        <CourseInfo>대학생 김모씨 (23세)</CourseInfo>
      </CourseProcessContainerColumn>
    </CouserProcessContainer>
  </Container>
);

export default DividerW;
